// Common conversion categories and their most used conversions
const commonConversions = [
  {
    category: "Length",
    conversions: [
      { from: "meters", to: "feet" },
      { from: "kilometers", to: "miles" },
      { from: "centimeters", to: "inches" }
    ]
  },
  {
    category: "Weight",
    conversions: [
      { from: "kilograms", to: "pounds" },
      { from: "grams", to: "ounces" },
      { from: "metric tons", to: "short tons" }
    ]
  },
  {
    category: "Temperature", 
    conversions: [
      { from: "celsius", to: "fahrenheit" },
      { from: "celsius", to: "kelvin" },
      { from: "fahrenheit", to: "kelvin" }
    ]
  },
  {
    category: "Volume",
    conversions: [
      { from: "liters", to: "gallons" },
      { from: "milliliters", to: "fluid ounces" },
      { from: "cubic meters", to: "cubic feet" }
    ]
  }
];

export default commonConversions;
